import React from 'react';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
    <Navbar />
    <Router>
    <Route path='/' exact />
    </Router>
    </Router>  
    </>
  );
}

export default App;
